var page = require("webpage").create();
var system = require("system");
var address = system.args[1]; // 截图页面地址
var output = system.args[2]; // 保存图片名
var width = 1600;
page.viewportSize = {width: width, height: 200}; // 页面初始高度
page.open(address, function (status) {
  // 打开页面
  if (status === "success") {
    // 加载完成
    // 通过在JS获取页面的渲染高度
    console.log("execute js");
    var a = page.evaluate(function () {
      document.getElementsByTagName("body")[0].insertBefore(
        (function () {
          var b = document.createElement("div");
          b.innerHTML =
            "<img src='data:image/png;base64,' />";
          return b;
        })(),
        (function () {
          return document.getElementsByTagName("body")[0].children[0];
        })()
      );
    });

    console.log("get height", a);
    var he = page.evaluate(function () {
      return document.getElementsByTagName("body")[0].scrollHeight;
    });

    // 按照实际页面的高度，设定渲染的宽高
    page.clipRect = {
      top: 0,
      left: 0,
      width: width,
      height: he + 103,
    };
    // 预留一定的渲染时间
    window.setTimeout(function () {
      page.render('images/test1.jpg');
    }, 1000);

    // 预留一定的渲染时间
    window.setTimeout(function () {
      page.evaluate(function () {
        return document.getElementById("transDetailMenu").click();
      });

      setTimeout(function () {
        var he = page.evaluate(function () {
          return document.getElementsByTagName("body")[0].scrollHeight;
        });

        // 按照实际页面的高度，设定渲染的宽高
        page.clipRect = {
          top: 0,
          left: 0,
          width: width,
          height: he + 103,
        };
      }, 1000);

      setTimeout(function () {
        page.render('images/test2.jpg');
      }, 2000);
    }, 1100);

    setTimeout(function () {
      page.close();
      console.log("success");
      // @ts-ignore
      phantom.exit();
    }, 5000);
  }
});
